import React, { Component } from 'react';
// import logo from './logo.svg';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import Home from './components/Home'
// import ProjectsContainer from './containers/ProjectsContainer'
// import BlogPostsContainer from './containers/BlogPostsContainer'

class App extends Component {
  render() {
    return (
      // any component in app can now set up routes and links
      <div className="App" >
        <Router>
          {/* <Navbar /> */}
          {/* <Route path='/about' component={About} /> */}
          <Route exact path='/' component={Home} />
          <Route exact path='/projects' render={routerProps => <ProjectsContainer {...routerProps} />} />
          <Route path='/blog' component={BlogPostsContainer} />
        </Router>
      </div>
    );
  }
}

export default App;
